o=A.aA("Opcon is a mobile application that its users can create profiles and messaging their contact. But it offers more than a standard messaging application, the difference between Opcon and other messaging application is that Opcon let its users manage their phones by sending notifier to each other.","Opcon, kullan\u0131c\u0131lar\u0131n profil olu\u015fturabildi\u011fi, mesajla\u015fabildi\u011fi bir uygulama. Peki fark\u0131 ne? Fark\u0131 ise, bir yandan mesajla\u015f\u0131rken di\u011fer bir yandan mesajla\u015ft\u0131\u011f\u0131n\u0131z ki\u015finin telefonunda meydana gelen baz\u0131 olaylardan haberdar olman\u0131z. Nas\u0131l m\u0131? T\u0131pk\u0131 bir resim g\xf6nderir gibi, mesajla\u015ft\u0131\u011f\u0131n\u0131z ki\u015fiye bir \u201cbildire\xe7\u201d g\xf6ndererek, kar\u015f\u0131 taraf\u0131n da bu bildireci kabul etmesiyle birlikte, onun telefonuna (bildirecin i\xe7eri\u011fine g\xf6re) belirledi\u011finiz bir ki\u015fiden arama geldi\u011finde bildirim alman\u0131za ya da kar\u015f\u0131 taraf belirledi\u011finiz bir ki\u015fiyi arad\u0131\u011f\u0131nda bildirim alman\u0131za ya da bu durumun ayn\u0131s\u0131n\u0131n mesajlar i\xe7in ge\xe7erli hali. Tabii, yapabildikleriniz bunlarla s\u0131n\u0131rl\u0131 de\u011fil. Kar\u015f\u0131 taraf\u0131n telefonuna bir alarm eklemek (Saat 12:00'da O\u2019nu uyar.), belli bir saatte ve tarihte belirledi\u011finiz bir yerde oldu\u011fundan emin olmak (X tarihinde, Y ile Z saatleri aral\u0131\u011f\u0131nda N konumuna M\u2019 km|m kadar yak\u0131nsa O\u2019na \u015funu hat\u0131rlat veya bana bildirim g\xf6nder.). Ve daha bir \xe7ok \u015fey. Yap\u0131s\u0131 itibari ile Opcon, bir \xe7ok senaryonun uygulanabilece\u011fi bir uygulama.")
